import { StyleSheet} from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#1C2833',
      justifyContent:"center",
      alignItems:"center",
    },
    containerItem:{
      backgroundColor:"#020122",  
      margin: 5,
      width: 175,
      alignItems:"center",
      justifyContent:"center",
    },
    view:{
      justifyContent:"center",
      alignItems:"center"
    },
    text:{
      color:'white',
      fontSize:15,
      margin:25,
      fontWeight:'bold',
    },
    img:{
      width: 150,
      height: 300,
      marginBottom: 10
    }
  });
  
  export default styles;
